InputParameter.Tooltip:
A two dimensional list of Colors. The list of colors must be square. Attempting to pass a jagged array will result in an exception.

Color[][]
Default value : {{DSCore.Color.ByARGB(255, 255, 0, 0), DSCore.Color.ByARGB(255, 255, 255, 0)}, {DSCore.Color.ByARGB(255, 0, 255, 255), DSCore.Color.ByARGB(255, 0, 0, 255)}}
